66-16 Through the Bible Revelation 4:5-11 by BRETT MEADOR|May 22nd,2013 HD

The God of unconditional love, amazing grace, and imputed righteousness created you for His perfect purpose, for His pleasure. Whether you know it or not, the Lord speaks with a voice of many waters - in many ways. Join us in Revelation 4 as we learn what heaven will look like, and study God's heavenly throne.

Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.  
